      console.log(`selected ${value}`);
    }
    return (
      <div>
        <h1>当前求和为：{ }</h1>  <br />
        <Select defaultValue="1" style={{ width: 50 }} onChange={handleChange}>
          <Option value="1">1</Option>
          <Option value="2">2</Option>
          <Option value="3">3</Option>
        </Select>
        <PlusOutlined />
      </div>
    )
  }
}
